import React from "react";

const PurchasableAsset = ({ item }) => {
    return (
        <tr>
            <td>{item.name}</td>
            <td>{item.model}</td>
            <td>${item.cost.toFixed(2)}</td>
            <td><button type="button" class="btn btn-primary">Purchase</button></td>
        </tr>
    )
}

export default PurchasableAsset
